import React, { useEffect, useState } from "react";

function Content({ response }) {
  const content = response ? (
    <div>
      <img src={response["thumbnail-url"]}></img>
      <p>Character name</p>
      <p>{response["thumbnail-url"]}</p>
      {console.log(responsep["thumbnail-url"])}
    </div>
  ) : (
    <p>other content</p>
  );

  return (
    <div>
      <p>Data will appear here</p>
      {content}
    </div>
  );
}

export default Content;
